import React, { Component } from "react";

class Dashboard extends Component {
  state = {
    loading: true,
    results: null
  };

  componentDidMount() {
    fetch("http://20.191.211.229:5000/v1/datafiles?filetype={filetype}&max_size=30", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(res => {
        return res.json();
      })
      .then(data => {
        this.setState({ results: data, loading: false });
      });
  }

  render() {
    return (
      <div>
        {this.state.loading || !this.state.results ? (
          <h1>Loading...</h1>
        ) : (
          <div>
            {this.state.results.map(result => {
              return <h1>{result.filename}</h1>;
            })}
          </div>
        )}
      </div>
    );
  }
}

export default Dashboard;
